import React from 'react';
import ReactDOM from 'react-dom';
// import './index.css';
const img1 = "https://picsum.photos/200/300";
const img2 = "https://picsum.photos/250/300";
const img3 = "https://picsum.photos/300/300";


const heading = {
  color : 'darkorchid',
  textAlign : 'center',
  textTransform : 'bold',
  fontWeight : 'bold',
  fontFamily : 'monospace',
  textShadow : '0px 2px 4px rgb(174, 111, 206)',
  margin : '50px 0'
}

const imgDiv = {
  display: 'flex',
  justifyContent: 'center'
}

const divImg = {
  width: '250px',
  height: '300px'
}

ReactDOM.render(
  <>
    <h1 style={heading}>
      My Name is Nand Makadia
    </h1>
    <div style = {imgDiv}>
      <img style = {divImg} src={img1} alt="This is Lorem Images"/>
      <img style = {divImg} src={img2} alt="This is Lorem Images"/>
      <a href="https://www.google.com/" target= "_blank">
        <img style = {divImg} src={img3} alt="This is Lorem Images"/>
      </a>
    </div>
  </>
  ,
  document.getElementById("root")
)
